    @staticmethod
    def Token(length: int = 16) -> str:
        return token_hex(length)

    @staticmethod
    def RealString(length: int = 16) -> str:
        return "".join(choices(ascii_letters + digits, k=length))

    @staticmethod
    def String(length: int = 16) -> str:
        return token_urlsafe(length)

    @staticmethod
    def Bytes(
        length: int = 16, seed: int | float | str | bytes | bytearray | None = None
    ):
        if seed:
            r = Random(seed)
            return bytes([r.randint(0, 255) for _ in range(length)])
        else:
            return token_bytes(length)

    @staticmethod
    def RandomAminoID():
        return f"{choice(Generator.VERBS)}{choice(Generator.ADJECTIVES)}{choice(Generator.NOUNS)}{randint(0, 1048576)}"
